ur help.',1456),(141,561,'2012-09-11 15:00:00',NULL,'phone','2012-09-10 23:17:39','2012-09-10 23:17:39','I live in Las Vegas, NV and was late paying my rent for this month and had to pay a $50 late fee along with the rent after the 5th day that the sum was due.  The property mangers called me today and said I still owed them another $35 for the costs associated with an eviction process.  In my lease agreement it states these words exactly, \"eviction costs: Tenant shall be charged an administrative fee of $35 per eviction attempt to offset the costs of eviction notices and proceedings.\"  The rent was due by the 5th, which was last Wednesday, and today is now Monday the 10th.  And as of today I still have yet to have received the eviction notice on my front door.  But yet, their telling me that I still owe them the $35 fee for the eviction process.  Tell me if i\'m wrong, but it seems extremely unfair for them to charge me for something that I haven\'t even received yet.  I\'m not sure if they\'re trying to pull one over on me or if this is a legitimate charge. They have been known for their shady business practices in the past and have screwed me over on several occasions so I just want to be sure on how to proceed with the situation.  Thank you for your help.',1456),(142,791,'2012-09-11 21:30:00',NULL,'phone','2012-09-11 18:36:14','2012-09-11 18:36:14','Selling a web business',1467),(143,1119,'2012-09-11 22:30:00',NULL,'phone','2012-09-11 19:31:18','2012-09-11 19:31:18','',1469),(144,821,'2012-09-12 22:00:00',NULL,'phone','2012-09-12 19:59:32','2012-09-12 19:59:32','',1485),(145,1373,'2012-09-12 23:30:00',NULL,'phone','2012-09-12 22:30:19','2012-09-12 22:30:19','I am going to court for two boys that I have with one guy. For the past 5 years my fiance has been taking care of the boys financially and physically. Can my fiance say anything in court or be put on my case?',1487),(146,450,'2012-09-13 14:30:00',NULL,'phone','2012-09-13 14:26:05','2012-09-13 14:26:05','Te