INSERT INTO `messages` VALUES (1,'this is a test.',6,9,'2012-08-09 22:55:55','2012-08-09 22:55:55'),(2,'Couple divorces 3 years ago. Husband has life insurance on himself with ex wife as beneficiary. He applies for medicaid this year when he enters hospice and dies 3 months later. He never disclosed life insurance policy to Medicaid. Will the ex-wife get it? It\'s $25,000.',1031,549,'2012-08-11 05:47:36','2012-08-11 05:47:36'),(3,'I was going up a stairs at a hotel n the stairs broke on me and hurt my knee n ankle....didn\'t went to doctor BC I don\'t know if I have a case..I have picture of it n the hotel know about it! They wasn\'t nice at all about it.',1041,108,'2012-08-12 14:11:50','2012-08-12 14:11:50'),(4,'help with keeping kids father away from them',1042,351,'2012-08-12 19:04:05','2012-08-12 19:04:05'),(5,'Hi,\nI recently received a public intoxication charge &amp; a charge for having my mothers clonazepam bottle in my purse (even though I\'m her power of attorney and I monitor her medication). I was not high nor drunk at the time I was arrested. I hadn\'t slept in over 36 hours and I tried to explain the police officer this when he found me taking a nap in Walmart parking lot. I told him I\'d be more than willing to give him a urinalysis or a blood test but I never received one. I am 6 months pregnant &amp; I need to know how these charges could affect me, especially being pregnant.   \nThank you',1049,450,'2012-08-13 12:46:55','2012-08-13 12:46:55'),(6,'i wrote a check for 25 dollars to publix supermarket the check bounced i\nhad planned to cover the check but an unforeseen problem happened my mother had gotten hurt when she fell and i totally forgotten about it i went to the store to pay it i was told that they already forwarded it to the state attorneys office i talked to an 800 number which the store gave me it was for check enforcement they told me that the check was not for 25 dollars it was 216.09 and now i got a  text book in the mail detailing  on how to recover for wrting a bad check my question is this do i need to complete the textbook',1038,275,'2012-08-13 14:41:00','2012-08-13 14:41:00'),(7,'I titled a car in my name and loaned it to my daughter and she got into an accident under my insurance and now she has junked the car with a bogus title after I sent her a certified letter stating I wanted the car back by the 11th she sold it for junk on the day after she got the notice. I know where the car is and I have a copy of bill of sale and a copy of the bogus title she used. I would like to know what my rights are considering the car is still in my name.\n',1055,762,'2012-08-13 22:04:22','2012-08-13 22:04:22'),(8,'i wrote out a check for 25 dollars to publix supermarkets and check was unpaid i was going to cover the check at the store they told me they no longer have they forwarded it to palm beach state attorneys office they gave me a number to call it was check enforcement i was told by them that the was no longer 25 dollars it was 216.09 and i was also told i would be prosecuted if i did not pay the fine which i did on aug 3 and  i was put in a diversion program.\nand i got a textbook in the mail saying that i have to complete it in 30 days by mail or online my question is do i need to complete the textbook.\n\njoseph Pace\njoe496@gmail.com',1038,562,'2012-08-14 15:28:54','2012-08-14 15:28:54'),(9,'Hello,\nI\'m a nonimmigrant worker on H1B. I\'m supposed to be working as a systems analyst for the company, but since there\'s not much to do, i help with sales. My co-worker (a female US citizen) and i got into a screaming argument yesterday. She threatened to call immigration on me. Should i be worried about anything? I went to school here, did 1 year of  my Bachelors and completed my MBA here as well. ',1069,86,'2012-08-14 20:53:22','2012-08-14 20:53:22'),(10,'I want to get out of an acknowledgement of debt that I signed in order to help another person',1070,21,'2012-08-14 20:54:24','2012-08-14 20:54:24'),(11,'i wrote out a check for 25 dollars to publix supermarkets and check was unpaid i was going to cover the check at the store they told me they no longer have they forwarded it to palm beach state attorneys office they gave me a number to call it was check enforcement i was told by them that the was no longer 25 dollars it was 216.09 and i was also told i would be prosecuted if i did not pay the fine which i did on aug 3 and i was put in a diversion program.\nand i got a textbook in the mail saying that i have to complete it in 30 days by mail or online my question is do i need to complete the textbook.\n\njoseph Pace\njoe496@gmail.com\n',1038,768,'2012-08-14 21:18:07','2012-08-14 21:18:07'),(12,'hi trevor my name is taletha and i have court sept 13 for misuse of credit card of 10 grand with my own card..i let a friend use my account what can i do to keep out of jail?',1071,63,'2012-08-14 21:28:53','2012-08-14 21:28:53'),(13,'My boyfriend got into a fight with his moms boyfriend last Decemeber. The other man didnt want to press charges but the police automatically did it anyway. He was charged with assault bodily injury-family member , it eventually turned into a warrant . He has one other speeding ticket for $400. He has never been in jail or any kind of trouble ever. He got arrested on Thursday and has court on the 16th of this month. How much jail time is he looking at , if any ?',1073,15,'2012-08-14 22:51:20','2012-08-14 22:51:20'),(14,'My boyfriend got into a fight with his moms boyfriend last Decemeber. The other man didnt want to press charges but the police automatically did it anyway. He was charged with assault bodily injury-family member , it eventually turned into a warrant . He has one other speeding ticket for $400. He has never been in jail or any kind of trouble ever. He got arrested on Thursday and has court on the 16th of this month. How much jail time is he looking at , if any ?',1073,115,'2012-08-14 22:52:10','2012-08-14 22:52:10'),(15,'My boyfriend got into a fight with his moms boyfriend last Decemeber. The other man didnt want to press charges but the police automatically did it anyway. He was charged with assault bodily injury-family member , it eventually turned into a warrant . He has one other speeding ticket for $400. He has never been in jail or any kind of trouble ever. He got arrested on Thursday and has court on the 16th of this month. How much jail time is he looking at , if any ?',1073,193,'2012-08-14 22:52:48','2012-08-14 22:52:48'),(16,'Help!? My wife hit a car in the parking lot. No damage. Man says no problem and he leaves. No police. Our insurance was lapsed at the time. Now he\'s showing up at her job. Are we liable since he left the scene?\n',1075,74,'2012-08-15 00:08:57','2012-08-15 00:08:57'),(17,'how would a father lose his rights if he has sex with a girl that was 15 and he was 20 and  he left wen he knew the girl was pregnant and hasnt been around for 5 years and now since he has a child support case against him he trying to come in her life and the child was raised by a different guy since she was born and the guy and the girl has been married for 4 year\n',1076,21,'2012-08-15 00:51:13','2012-08-15 00:51:13'),(18,'i wrote out a check for 25 dollars to publix supermarkets and check was unpaid i was going to cover the check at the store they told me they no longer have they forwarded it to palm beach state attorneys office they gave me a number to call it was check enforcement i was told by them that the was no longer 25 dollars it was 216.09 and i was also told i would be prosecuted if i did not pay the fine which i did on aug 3 and i was put in a diversion program.\nand i got a textbook in the mail saying that i have to complete it in 30 days by mail or online my question is do i need to complete the textbook.\njoseph pace\njoe496@gmail.com',1038,970,'2012-08-15 22:03:06','2012-08-15 22:03:06'),(19,'If im a minor, and im charged with perjury, what could possbily happen? Could i go to jail?',1093,536,'2012-08-16 03:23:34','2012-08-16 03:23:34'),(20,'I received notice of a referee hearing about a month ago regarding modification of child support.  I went to the hearing on the scheduled date and time.  When called to sign in I was informed that my hearing was adjourned.  When I asked why and that I had no knowledge of the change the Friend of the Court told me my ex husband retained an attorney and had the date changed, i was told I should  have received a notice from the attorney.  I contacted the FOC the next day and was told the attorney filed the form to change the hearing date and said that i had consented to the change and that all parties mutually agreed upon the new date.  I NEVER CONSENTED TO ANYTHING!  I had no idea that there was change, no idea who this attorney is, and never received notice from this attorney.  I want to know if I can file a complaint on this attorney.  She submitted a form to the courts that i never saw or consented to.  What can I do?  I will be attending the next hearing date, should I mention this to the referee?',1092,701,'2012-08-16 03:27:46','2012-08-16 03:27:46'),(21,'If im a minor in kenmore, ny. Im 15, and if im charged with purgury, what could happen to me?',1093,289,'2012-08-16 03:51:28','2012-08-16 03:51:28'),(22,'i have  a probation violation hearing coming up due to not pay my fines or attending work release because i have no job to pay for either. what\'s going to happen? i\'m in san bernardino county, i missed my first hearing because i had to go to school and got arrested the next day before i could attend court the following monday.',1094,70,'2012-08-16 05:36:38','2012-08-16 05:36:38'),(23,'i have  a probation violation hearing coming up due to not pay my fines or attending work release because i have no job to pay for either. what\'s going to happen? i\'m in san bernardino county, i missed my first hearing because i had to go to school and got arrested the next day before i could attend court the following monday.',1094,268,'2012-08-16 05:44:36','2012-08-16 05:44:36'),(24,'I purchased a vehicle which broke down the same day. The dealer refused to fix it. Its now been a few months and I have had to fix it numerous times. Is he still liable to refund some money?',1099,333,'2012-08-16 16:05:47','2012-08-16 16:05:47'),(25,'Hi , Im in need of help. Im 19 years old and I have a son, a job, and a home, but made the wrong choice of what car I got in one night. I was in the passenger seat of a stolen vehicle that I had no clue was stolen. I was charged with Possession Of Stolen Property. Id very much appriciate for some input, some type of help. I do not see how I can be charged with possession if I had no idea, or any type of control of the situation. All I needed was a ride to McDonalds. Please Help Me Sir.',1100,450,'2012-08-16 16:31:16','2012-08-16 16:31:16'),(26,'I wrote you a message already sir. If you\'d please return my call as soon as possible. I know there is something I can do. I\'m a single father. I can\'t lose my Son sir. Please return a message or a call please. 304 490 9151',1100,450,'2012-08-16 16:47:37','2012-08-16 16:47:37'),(27,'Ive been wondering this for a while now, but is it possible to marry someone in jail?',1101,289,'2012-08-16 17:09:06','2012-08-16 17:09:06'),(28,'Ie been wondering this for a while now, but is there any possible way to marry someone in jail?',1101,21,'2012-08-16 17:12:58','2012-08-16 17:12:58'),(29,'Ive been wondering this for a while now, but is there any possible way to marry someone in jail?',1101,294,'2012-08-16 17:15:29','2012-08-16 17:15:29'),(30,'Hey, I need some help. Basically this is the run down...I\'m on felony probation for possesion for sales, I was ordered to work release to serve the rest of my time, which i attented until I messed it up, and then stopped going and checking in with probation. I\'ve heard of these new laws, and flash incarceration, so basically what I\'m asking is if I were to turn myself in, would they do this to me, seeing that I fit all the criteria under these new penal codes.? thank you I need to turn myself in the guilt is eating at me and i can\'t relax at all. I have 3 months left under work release. Basically all I have is a violation.',1106,508,'2012-08-16 21:36:18','2012-08-16 21:36:18'),(31,'I have a question about a mortgage &amp; how it can be resolved in a divorce.\nLong story short, wife &amp; I have a $1800 house mortgage that has both of our names on it.  \nI caught her cheating (cyber affair), she did not want to reconcile &amp; now we are heading to a divorce.  \n\nWe have jointly decided that we should sell the house.  \n\nShe is a nurse &amp; has told me that she is wanting to go on travel nursing jobs (in Florida, our home state).  My plan was for me to stay in the house &amp; make improvements until it is sold (repairing, painting, etc).  This is while she is gone as a travel nurse.  My job is in our town (Tallahassee).\n\nI have sent her an agreement (informal) about issues such as debts, cars, etc.  We are in agreement that we will keep our own bank accounts, debts, cars, 401k, etc.  The only thing we do not agree on is our mortgage,\n\nShe has since sent me an agreement  saying that she would pay $400 a month for a maximum of 9 months, until we sell the house.  \n\nI have learned now that travel nurses get either free housing or they get a stipend for housing from the travel agency that they go with.  I also understand that it is tax free if they have a permanent house in the state in which they live.\n\nWhat are my legal standings with her doing this?  I do not feel it is fair for her to only pay $400 of our mortgage while she gets her housing for free as a travel nurse.\n\nthank you\ntr_arch@yahoo.com',1131,970,'2012-08-17 23:39:24','2012-08-17 23:39:24'),(32,'walking down the street 9 am with 2 other friend police pulled up said they had a call about peace disturbance and we fit the description. we provided name upon request but one friend took off running. and us 2 were immediately arrested and charged wit peace disturbing with no evidence they we had commit the crime. charged with interference because i didnt provide a name which they already had for the guy that ran. charged with peace disturbance/interference',1133,390,'2012-08-18 01:02:52','2012-08-18 01:02:52'),(33,'my husband caught an aggravated robbery case in 1999 and received 5 years, in 2010 he was convicted of felony theft and received 14 months this month he caught a 1st degree felony for burglary of habitation, if i wrote the jugde and begged for leniency do you think they would consider the favor? if he leaves my children and i will be homeless',1142,821,'2012-08-18 16:39:21','2012-08-18 16:39:21'),(34,'my husband caught an aggravated robbery case in 1999 and received 5 years, in 2010 he was convicted of felony theft and received 14 months this month he caught a 1st degree felony for burglary of habitation, if i wrote the jugde and begged for leniency do you think they would consider the favor? if he leaves my children and i will be homeless',1142,550,'2012-08-18 16:39:45','2012-08-18 16:39:45'),(35,'my husband caught an aggravated robbery case in 1999 and received 5 years, in 2010 he was convicted of felony theft and received 14 months this month he caught a 1st degree felony for burglary of habitation, if i wrote the jugde and begged for leniency do you think they would consider the favor? if he leaves my children and i will be homeless',1142,200,'2012-08-18 16:40:06','2012-08-18 16:40:06'),(36,'If I have an open DCF case in CT because of predictive neglect and now live in rhode island where there is no predictive neglect and am 35 weeks pregnant. what can happen to my unborn child once hes born if CT calls RI? ',1146,227,'2012-08-18 23:57:49','2012-08-18 23:57:49'),(37,'If i have an open cps case in Ct cuz of predictive neglect and now reside in Rhode island where predictive neglect law doesn\'t exist.. what c