r a loan?? ',1240,270,'2012-08-27 05:59:17','2012-08-27 05:59:17'),(53,'my mom pressed charges against my fiance for stealing her credit card to  put gas in my car but we\'ve now come to the conclusion that she gave him the card and the card has been found it was in the vehicle the have put my fiance in jail they just put him in today can she drop the charges',1244,294,'2012-08-27 16:27:29','2012-08-27 16:27:29'),(54,'I am 17 years old. I have a baby and I am married. I recently left my husband because of his controlling ways and there has been abuse. He\'s drug me down a hall, jerked my son out of my arms, and has head butted me. He hasn\'t ever really punched me or anything. He\'s pushed me. He also did/does drugs and that\'s one reason why I left. My mother is saying that they\'re going to take my son. I\'ve filed for custody but today I found out that because I am 17 I cannot file for custody. I need to know what I can do legally. My husband could not take care of my son by himself. He doesn\'t even like to change his diapers.',1266,580,'2012-08-28 18:56:46','2012-08-28 18:56:46'),(55,'I am 17 and I got married. Does that make me legally emancipated?',1266,914,'2012-08-28 19:32:00','2012-08-28 19:32:00'),(56,'I HAVE COURT TODAY HERE IN NM AND I WAS NEEDING SOME ADVICE IT\'S FOR VIOLATION OF PROBATION I\'M A SINGLE MOM WHAT CAN I DO TO KEEP FROM GOING TO JAIL ',1270,744,'2012-08-28 20:55:31','2012-08-28 20:55:31'),(57,'I HAVE COURT TODAY HERE IN NM AND I WAS NEEDING SOME ADVICE IT\'S FOR VIOLATION OF PROBATION I\'M A SINGLE MOM WHAT CAN I DO TO KEEP FROM GOING TO JAIL ',1270,791,'2012-08-28 20:57:27','2012-08-28 20:57:27'),(58,'I HAVE COURT TODAY IN NM ON VIOLATION OF PROBATION I\'M HOPING YOU WILL BE ABLE TO HELP ME OUT ON THIS I NEED THE ADVICE OF WHAT TO DO ',1270,791,'2012-08-28 21:16:05','2012-08-28 21:16:05'),(59,'i have court today at 5 and i need some advice if you could get back with me asap i would so apprecate it my number is (575)318-0928',1270,559,'2012-08-28 21:24:30','2012-08-28 21:24:30'),(60,'i have court today at 5 if you could give me a call back that would be great (575)318-0928',1270,200,'2012-08-28 21:27:32','2012-08-28 21:27:32'),(61,'Hi Jacob, \n\nI hope you are well. Got a quick question. I got my incorporation paperwork today from my accountant, but due to my mistake there is a name error on the documentation. I recently changed my name to Sonia Carrillo Colchado (Carrillo middle name), from Sonia Carrillo. The Incorporation paperwork only states Sonia Carrillo. Is this a problem and will it be difficult to change it? ',1274,270,'2012-08-29 05:30:53','2012-08-29 05:30:53'),(62,'Shoplifting legal advice in MO\nHide Details\n\nFROM:\n\n        Patuszka\n\nTO:\n\n        nasp@shopliftingprevention.org\n\nMessage flagged\nWednesday, August 29, 2012 12:37 AM\nDear Sir/Madam,\nI\'m writing because I would like to ask for some legal advice. About a month or two month ago I have done something that I know I shouldn\'t have done. I got caught shoplifting for the first time. When I was walking out of the store, a security guard have stopped and took me to the back office. After searching my purse he retrieved two deodorants which I have taken. Retail value of bought items does not exceed $10. After security guard asked me to to sign paper stating that I will never come to this store again, then he took my picture.\n\nNow I have received a fallowing letter stating:\n\nรขโฌลOur Client: SHOP\'N SAVE\nBalance due: $410.14\nService date: 07/04/2012\n\nGood Morning:\n\nPlease be advised that our office has been asked to represent Shop N Save Warehouse Foods in its claim for civil recovery, based upon an incident in which you were recently involved at one of our client\'s stores. Under Missouri stature 570.087 R.S.Mo, our client can assert a claim for a penalty of up to $250.00, the full retail value of the merchandise involved, plus its incidental costs of security, not to exceed $100.00, for a reasonable attorney\'s fee(calculated at this time at $50.00), and court costs should litigation be instituted on our client\'s behalf.\n\nIncidents of this nature cost merchants enormous sums each year, and our client takes the lesses from shoplifting very seriously. Kindly forward your payment to our office immediately, made payable to our client, in order to bring the matter to a resolution. Please note our four digit code on your payment. We look forward to your prompt response.\n\nVery truly yours,\nTIFFANY *******\nAccount Administrator รขโฌล\n\nAs of end of January I am a stay at home mom. I was injured at work and was refused workmen\'s comp. I am still hurt and not able to work and have lost my job. That is the reason I made a decision to take something that I needed but can\'t afford. I have not done this before and will never do it again. I have never been arrested or have any records.\n\nI have done some research on the net to find out what are my rights and what I should do. Some say not to do anything and ignore the letters and that they will probably not want to bother with taking it to curt for something that is under $10. But I don\'t want to be in trouble or do something that will regret later. Like I said I have never done this before and will not do it again but I can\'t afford to pay for a product that is under $10 not to mentioned $410.14. How did they figure that sum? What should I do? My husband makes just enough money to brake even with all our bills at the end of the month. This is after his hours where reduce last year. Should I try to contact Shop\'N Save directly and reason with them?\n\nAny advice you can give me would be greatly appreciated.\n\nThank you.\n\nSincerely,\n\nPatricia Dar\n\n\n',1275,110,'2012-08-29 06:21:05','2012-08-29 06:21:05'),(63,'Shoplifting legal advice in MO\nHide Details\n\nFROM:\n\n        Patuszka\n\nTO:\n\n        nasp@shopliftingprevention.org\n\nMessage flagged\nWednesday, August 29, 2012 12:37 AM\nDear Sir/Madam,\nI\'m wr