k it up tomorrow, she NEVER showed up. We must have called 7 or 8 times to get her to pay for and pick up the computer. It has now been well over 3 months and she never called or came back to pick it up. The customer forgot to put her address on the intake form, so we had NO way of sending her a certified letter stating she needed to pick it up or it would be considered abandoned. Now almost 3 1/2 months later she calls on a holiday ( Labor Day ) and want to come in and pick it up.\n\nWe all ready disposed of the computer as it was very old and not worth selling or keeping.\n\nWhat are our legal rights regarding this? ',1340,1208,'2012-09-03 20:17:12','2012-09-03 20:17:12'),(73,'I live in a gated apartment community in south Florida. Today I received a call from one of the ladies at the front desk stating that one of my neighbors had several photos of me outside my apartment door. My neighbor was accusing me of not picking up after my dog. Now the ladies at the office said there was no proof in the photos, which I knew already because I do pick up after my pet. However that is private property and where I live. Honestly, I feel uncomfortable going in and out of my apartment. I feel like I\'m being watched every time. Is that illegal? Invasion of privacy perhaps?',1354,652,'2012-09-04 18:48:24','2012-09-04 18:48:24'),(74,'if you dont give a terms notice for a privet school do you end up paying the fees for next term also?',1356,270,'2012-09-04 20:37:35','2012-09-04 20:37:35'),(75,'Hi Mr. MicGinity,\n\nI tried to send both lease agreements today to: michelle@brianmcginitylaw.com \nHowever it said that it was not a valid email address? Did I misspell the email? Please let me know thank you.\n',1320,636,'2012-09-05 02:02:05','2012-09-05 02:02:05'),(76,'is a person aged 15 able to leave their house/runaway with no repercussions? ',1365,104,'2012-09-05 03:09:47','2012-09-05 03:09:47'),(77,'Matrimonial case\nShyam and Seema have been studying in the law college. They fell in love and wanted to marry. Their parents were however not willing as they belonged to different castes and Shyam was very poor. The parents dissuaded Seema and took her away from the college. But Shyam followed her and entered into an agreement with her to live as husband and wife. They also exchanged garlands before some friends as was the custom followed by the caste to which Shyam belonged.\n            Both Shyam and Seemsa were disowned by their respective parents. Though they were majors and educated they could not find work. For some they pulled on by selling some belongings of Seema. After six months of their living together, Shyam asked Seema to sell her ornaments including the Mangalsutra (sacred thread/ornaments given by the husband), so that he could go to Dubai in search of a job. At first she was unwilling; however on persuasion she gave in.\n            Shyam could not find a job in Dubai. He went to Gokul, brother of Seema who was a chief of a company there. He rebuked Shyam and refused to give him a job. Aggrieved by him Shyam stopped sending letters to Seema who was living on the promises in Shyamรขโฌโขs letters. When the flow of letters stopped, she became panicky.\n            Shyamรขโฌโขs mother on learning the plight of her son in Dubai became angry. Almost daily she started coming to the rented house of Seema and cursing her in front of many. She alleged that seema was responsible for her sonรขโฌโขs sorrows. She said to Seema that she should die so that she may not give birth to her sonรขโฌโขs child.\n          Next day, Seema was found dead as a result of burns. It appeared that she committed suicide by pouring kerosene all over her body and get fire to her clothes.\n         Seemaรขโฌโขs parents complained to the police that their daughter was done to death by her mother-in-law. Police started investigation and filed charge sheet against Shyam and his mother under Section 498A and 304B read with Section 34 of Indian Penal Code. Both were found guilty by the trial Court. They appealed to the high court on several grounds including the following grounds:-\n1.	That Seema was not Shyamรขโฌโขs legally wedded wife and therefore both Sections 498A and 304B would not be applicable.\n2.	That the investigation against Shyam conducted by the police was irregular, improper and illegal as they did not obtain sanction from the Central Government.\n3.	That both Sections 498A and 304B need not be charged together as one charge would do.\nArgue.\n\n               \n',1367,104,'2012-09-05 05:40:08','2012-09-05 05:40:08'),(78,'Wanted to discuss a trademark with you.',1377,74,'2012-09-05 20:06:42','2012-09-05 20:06:42'),(79,'I\'m convicted felony and a immigrant and is in the U.S, how can I get my citizenship or some sort of paper to keep me in the U.S?... I just help.',1379,803,'2012-09-05 21:19:36','2012-09-05 21:19:36'),(80,'i co own a piece of property with another party and would like to know if both parties have to give permission to destroy the property',1382,74,'2012-09-06 13:34:20','2012-09-06 13:34:20'),(81,'i co own a piece of property with another party and would like to know if both parties have to give permission to destroy the property',1382,74,'2012-09-06 13:34:41','2012-09-06 13:34:41'),(82,'my friend is being accused of shoplifting. she did commit the crime. it\'s her first offense, she has NO criminal background of any kind, and i was wondering if she would be able to talk to the prosecutor about pleading to a lesser offense. it\'s too late for us to get a lawyer, and im trying to help her to deal with this the best way she can. how do we go about handling the court process so she has a minimal sentence and it doesn\'t stay on her record?',1388,263,'2012-09-06 14:28:34','2012-09-06 14:28:34'),(83,'I am dying from Lou Gehrigs disease, and I recently divorced my wife. I uneducatedly left her with everything, my business she now owns, our home she owns, the cars, and my retirements, 401k and 