INSERT INTO `offerings` VALUES (13,'Entity Formation Package - Single Member LLC Or Corporation','Up to eight hours of legal work to help you select the business legal entity for your business and to do all of the other necessary legal work to get your business started.',1200,'2012-03-08 21:21:16','2012-08-06 18:12:44',15,0),(14,'Review of Marital Separation Agreement','Review your Marital Separation Agreement and provide you with specific legal advice. Maryland DC residents only.',99,'2012-03-09 01:44:38','2012-03-09 01:44:38',104,41),(20,'Review of drafted prenuptial agreement (up to 15 pages)','I will review a prenuptial agreement drafted by another attorney (including online legal services, like LegalZoom) and conduct a phone consultation with you re: the agreement.\r\n\r\n(If your prenup is longer, we can discuss the fee.)\r\n',350,'2012-03-12 01:15:17','2012-03-12 01:15:53',21,36),(22,'Trademark application for an intent to use mark','Basic Search, review, application, statement of use ',895,'2012-03-13 22:08:55','2012-03-13 22:08:55',130,108),(23,'Basic Trust Package','Basic Trust Package includes: Trust (to achieve probate avoidance), Transfer Deed for Real Property (1), Will, Durable Power of Attorney, Health Care Directive. $1595 for a married or registered domestic partnership.  $1295 for an individual.',1595,'2012-03-17 00:07:52','2012-03-17 00:07:52',135,43),(24,'Uncontested No Fault Divorce','$750 plus court fees ($335), requires spouse to cooperate. Does not include stipulation if there are children, marital property or pensions to distribute. ',750,'2012-03-19 03:09:14','2012-03-19 03:09:14',137,36),(25,'USCIS Spouse Petition and Adjustment of Status','Review of  I-130, I-485, I-864 and associated forms and review documentation and good faith affidavit preparation and review and tracked submission to lock box, and follow up until approval. No extra charges for standard RFEs. Does not include attending interview.  ',900,'2012-03-19 03:11:56','2012-03-19 03:11:56',137,38),(26,'Basic WIll, Durable POA and HCP','Will prepare basic will (without complex provisions,  testamentary or pour over trust) and execute Will with two witnesses and complete witness affidavits and provide client with original Will, Health Car Proxy and durable Power of Attorney (must be signed by agent with notarized signature) according to client instructions.',300,'2012-03-19 03:14:21','2012-03-19 03:14:21',137,43),(27,'Prenuptial agreement drafting','Will review your needs regarding assets, wishes regarding Equitable Distribution and Marital Property issues under New York law and draft prenuptial agreement to be reviewed by finance(e) legal/financial adviser(s). Does not include extensive negotiations, document revisions or out of office closings which are billed at $240 per hour. ',750,'2012-03-19 03:20:17','2012-03-19 03:20:17',137,36),(28,'Consultation-1 hour','Review fact situation and advise on possible immigration solutions based on personal and professional objectives. ',100,'2012-04-08 17:21:49','2012-04-08 17:21:49',166,41),(37,'Employee contract review - unlimited length','Review and comment to employee on employer\'s proposed terms of employment, give suggestions for additional negotiations.',650,'2012-05-09 20:29:13','2012-05-09 20:29:13',227,37),(38,'Separation agreement, no children','If you and your spouse have reached substantial agreement on the terms of a separation, including dividing the marital property, I will assist you in preparing a separation agreement for a limited fee.',500,'2012-05-10 01:19:31','2012-05-10 01:19:31',228,36),(39,'Uncontested divorce, no children','If your spouse does not contest the action (and can be located easily for personal service),  or is willing to sign a stipulation to settle the divorce action without extended negotiation, I will handle this matter for you for a limited fee.  This fee does NOT include court filing fees.',750,'2012-05-10 01:21:19','2012-05-10 01:21:48',228,36),(40,'Trademark Filing','I will draft file a trademark registration with the United States Patent and Trademark Office. Does not include government filing fees.',200,'2012-05-11 18:39:38','2012-05-11 18:39:38',233,108),(42,'NO RECOVERY FOR YOU, NO FEE!','WE WILL REVIEW YOUR PERSONAL INJURY CLAIM FOR FREE',0,'2012-05-14 20:13:54','2012-05-14 20:13:54',245,86),(43,'Lease review and rider preparation','Review existing lease and/or provide standard lease.  Draft custom rider, covering specific landlord concerns.',500,'2012-05-15 00:44:39','2012-05-15 00:44:39',246,40),(44,'Free consultations on personal injury cases.','Listen to client\'s case and give them advice on their matter.  Can assist clients in Southern California and especially Santa Clarita, CA area.',0,'2012-05-15 03:55:47','2012-05-15 03:55:47',250,86),(46,'1500.00 retainer','File complaints and pettions, attend court hearings, negotiate settlements, offer legal advice and counsel. ',2750,'2012-05-16 02:59:07','2012-05-16 02:59:07',257,36),(47,'3000.00','Negotiae with prosecutors, file and argue criminal motions, take the case to trial if necessary. ',4500,'2012-05-16 03:00:09','2012-05-16 03:00:09',257,116),(48,'30% contingency fee','Set up insurance claims, refer to a chiropractor or doctor, negotiae settlement, file lawsuit, if necessary and take case to final conclusion - a win for you!',45,'2012-05-16 03:01:38','2012-05-16 03:01:38',257,86),(49,'','telephone advice includes clear directions on how to handle NJ Municipal Court and Superior Court defense as a pro se.   Consult does NOT include personal appearance in Court or a personal meeting.   ',750,'2012-05-18 00:39:32','2012-05-18 00:39:32',263,116),(50,'free','free consultation and if I do not personally take your case for free I will make a referral to a good NJ attorney',0,'2012-05-18 00:40:50','2012-05-18 00:40:50',263,36),(51,'No-Fault Divorce Forms with Legal Advice in MD','All the forms for a Maryland no-fault divorce bundled with legal advice.',199,'2012-05-18 04:42:38','2012-05-18 04:42:38',104,36),(54,'Office Consults','Review all document, inform of the prevailing and a possible consequences of conviction, explore legal defenses and advide approriate alternatives.',300,'2012-05-18 12:48:47','2012-05-18 12:48:47',265,116),(57,'DWI / DUI','We handle all aspects of your Houston, Texas DWI case, leaving no stones unturned. From the initial challenge of your driverรขโฌโขs license suspension case through a final jury trial to your peers if necessary. This is where the experience matters. We are in a results oriented business, and our results speak for themselves.',1500,'2012-05-18 16:40:35','2012-05-18 16:40:35',266,116),(58,'DUI Defense- $1,000.00','Any misdemeanor DUI charge from arraignment to trial (if necessary) including representation at any DMV hearing that may be required to help you keep your Driver\'s License.  ',1150,'2012-05-19 00:06:30','2012-05-19 00:06:30',268,116),(59,'Misdemeanor Defense - $400.00','Representation for any misdemeanor charge from first appearance arraignment date through trial (if necessary).  We will be with you every step of the way in defending against your charges!',550,'2012-05-19 00:09:14','2012-05-19 00:09:14',268,116),(60,'Traffic Tickets Fixed - $50.00','Complete traffic citation representation including guaranteed no points on your driving record and no traffic school.  If we don\'t deliver, you don\'t pay!',75,'2012-05-19 00:11:21','2012-05-19 00:11:21',268,116),(61,'$500 for misdemeanor plea agreement.','Appear; negotiate with prosecutor; present plea agreement',500,'2012-05-21 00:26:38','2012-05-21 00:26:38',273,121),(62,'Chapter 7 bankruptcy (individual or couple)','Meet (in person or electronically); provide questionnaire; prepare and file petition; attend hearing(s).',990,'2012-05-21 00:28:21','2012-05-21 00:28:21',273,35),(64,'DUI 1st offense 2,500.00 ','All aspects of defense including trial ',5000,'2012-05-21 12:53:49','2012-05-21 12:53:49',275,116),(65,'DUI Repr