ds for the claim, and basis for the claimed amounts. ',500,'2012-05-31 00:46:20','2012-05-31 00:46:20',331,35),(76,'Foreclosure Defense Review.','Will review the entire file for the client\'s particular mortgage, including the lending forms, closing documents, follow-up correspondence with the bank, if any took place. Based on the facts obtained, will render an advise, whether the client has a foreclosure defense claim, and before what court. No guarantee of certain victory and prevailing in the cases will be given, only a prediction of whether the case is worth to pursue. Fee is charged per property.',500,'2012-05-31 00:51:45','2012-05-31 00:51:45',331,40),(77,'Web site Legal Policies','Create the following legal policies for use on a web site:\r\n\r\n1. Terms of Service\r\n2. Privacy Policy\r\n3. Copyright Notice\r\n4. Refund Policy\r\n5. Click-Wrap Agreement',1500,'2012-05-31 23:00:02','2012-05-31 23:00:02',333,41),(78,'Copyright Registration','Register creative works, including web sites, with the United States Copyright Office. ',500,'2012-05-31 23:01:02','2012-05-31 23:01:02',333,108),(79,'$325.00','Review contract and advise client on their rights within the contract',350,'2012-06-06 04:43:33','2012-06-06 04:43:33',360,41),(80,'$350.00','I will review the charges against the client, and advise as to a plan of approach in defense of the charges, and make an appearance. depending on the charges against the client the client may be charged an appropriate amount as a retainer for full representation and general appearance.',350,'2012-06-06 04:47:45','2012-06-06 04:47:45',360,116),(81,'contingency fee matter with automobile accidents','will represent client through settlement.',0,'2012-06-06 04:48:37','2012-06-06 04:48:37',360,86),(84,'Draft Simple Wills','Draft A Simple Will Containing Specific Bequests, General Bequests, Residue Of The Estate, And A No Contest Clause.',250,'2012-06-12 21:29:07','2012-06-12 21:29:07',380,43),(85,'Estate Planning','Power of Attorney\r\nHealth Care Surrogate for Self and Spouse\r\nWill for Self and Spouse\r\nOrgan Donor\r\n',1500,'2012-06-13 17:12:02','2012-06-13 17:12:02',384,43),(86,'Forming a Corporation or LLC and Related Corporate Minute Book','Filing the Articles of Incorporation or LLC\r\nDrafting the Operational Document or Bylaws\r\nStock Purchase Agreements\r\nStock Certificates\r\nIndemnification of Officers and Directors\r\nFiling of Fed and State Securities Exemptions\r\nOther requirements for special corporations (such as professional corporations)',900,'2012-06-15 03:16:11','2012-06-15 03:16:11',400,41),(87,'Assignment of Assets','A basic assignment of one member / shareholder\'s assets to the new corporation.',600,'2012-06-15 03:17:32','2012-06-15 03:17:32',400,41),(88,'Franchise Circular Review','Review of Uniform Franchise Disclosure Document (formerly, UFOC).  ',800,'2012-06-15 03:19:50','2012-06-15 03:19:50',400,41),(89,'Legal Vetting and Review of Manuscript','Will provide a letter independently reviewing a manuscript for potential matters of infringement, public domain, defamation, or other illegal matter.',2000,'2012-06-15 03:22:21','2012-06-15 03:22:21',400,108),(90,'Drafting a 8 to 12 page Media Licensing Agreement','Licensing refers to book publishing, video game distribution, film distribution, merchandising, technology licensing or the like.  The flat fee covers the first 12 pages. Each additional page might be an additional $50 as negotiated.',1200,'2012-06-15 03:25:50','2012-06-15 03:25:50',400,41),(91,'Trademark Review and Filing','I will help you review up to 5 marks under a basic search with the USPTO for free. Once there is a mark which is not taken, I will do a more thorough review per mark for $500.  Then, if advisable, I will file marks for $750 each (plus filing fees).  Will consider discounts for quantity work.',1250,'2012-06-15 03:31:19','2012-06-15 03:31:19',400,108),(92,'Sale of Assets - Workout','This is a negotiable fee based on the amount of work.',5000,'2012-06-15 03:32:45','2012-06-15 03:32:45',400,35),(93,'Sale of Assets / Sale of Stock / Financing','The work varies, but will consider the sale of a business or business interest for a small company or start up.  Fee varies based on the amount of work.',10000,'2012-06-15 03:34:14','2012-06-15 03:34:14',400,41),(94,'Drafting and Filing of Franchise Circular','In developing a franchise territory (for a marketing system or unit/territory of a retail outlet) you must draft and file in certain states an offering.  I will advise you, and the fee below represents what I might charge for an average Franchise offering to be filed in California.  Estimated time: 3 months.',18000,'2012-06-15 03:37:05','2012-06-15 03:37:05',400,41),(95,'Apply H1B Visa or Equivalent','I will apply for a visa using a staff of experienced immigration attorneys and paralegals. Does not include filing fees or RFE.',1500,'2012-06-15 03:39:34','2012-06-15 03:41:33',400,38),(97,'Estate plan - Revocable Living Trust, Powers of Attorney, Advanced HealthCare Directives, Pour-Over Wills','A comprehensive estate plan',3500,'2012-06-17 04:37:55','2012-06-17 04:37:55',411,43),(98,'Bezonsky Law-Complete Criminal Defense ','Bezonsky Law is a full-service criminal law practice.  We have successfully represented clients at every stage of the legal process, from pre-charge investigations all the way up to the actual trial and beyond.  ',1500,'2012-06-22 09:14:25','2012-06-22 09:14:25',450,116),(99,'Free consultation, no obligation.','Please visit our website at www.carrcarr.com for a free consultation.  ',NULL,'2012-06-25 20:50:54','2012-06-25 20:50:54',295,86),(100,'Estate Tax Planning and Asset Protection','Review of current estate planning and assets for families with greater than $2,000,000 and then design an estate plan that will meet needs, avoid taxes, and provide asset protection. ',3500,'2012-06-28 06:53:04','2012-06-28 06:53:04',499,112),(101,'Draft Documents to Implement Estate Plan','Revocable 