ments to a third party search firm are extra, and can vary depending on complexity of mark and the goods and services involved.',445,'2012-07-01 20:22:57','2012-07-01 20:22:57',74,35),(112,'Website Audit','A website audit is a review of your online presence to ensure that it complies with applicable U.S. law. The risks that an online business faces are, in general, similar to risks faced by brick and mortar businesses, except that the virtual world presents additional risks that are unique to the internet. From a legal perspective, online risks tend to fall into two major categories: compliance and security. In particular, privacy and data security issues will continue to receive increasingly more attention from consumers and from federal and state enforcement agencies that act on their behalf. More is at stake than can be measured by fines or from damages payable from the loss of a lawsuit. A risk management strategy that addresses online issues is critical to mitigating legal liability, but even more importantly, to maintaining your businessรขโฌโข reputation value. Although, conducting a website audit will not eliminate your legal liability, having the appropriate agreements in place, and the business processes that underpin them, will help to ensure that you are protected to the maximum extent allowed by law.',595,'2012-07-01 20:23:41','2012-07-01 20:23:41',74,108),(113,'Parenting Plan for Unwed Couples with Children','Includes Joint Custody Agreement (not applicable if Joint Custody with another party already ordered by Court); Authorizations for non-parent to consent to medical, surgical or dental examinations and treatment of a minor child; Authorizations for non-parent to deal with minor\'s school or daycare; Nomination of Guardian for a minor child.',750,'2012-07-02 14:27:00','2012-07-02 14:27:00',503,36),(114,'Uncontested Divorce','I will advise and represent you in an uncontested divorce, including preparing and filing the Petition for Dissolution of Mar