ter to inform the Court that I am the client\'s defense attorney.  I file appropriate motions.  If the client wants the case to resolve without a trial, I negotiate with the State to get the best possible outcome for the client.  If the client wants a trial, or the State forces a trial upon us, I prepare for battle and go into the courtroom ready to fight.  My fee for a trial case depends, among other things, on the severity of the charged offense, the facts of the case, the expected length of trial (or contested hearings), the expected difficulty (or not) of the fight ahead.  My fee for an appeal or application for writ of habeas corpus case is based on similar factors: expected time and effort necessary to zealously represent the client, and expected difficulty of the fight ahead.',NULL,'2012-07-27 20:52:16','2012-07-27 20:54:58',821,116),(171,'Arizona No Asset Chapter 7 (Total unsecured debt less than $30k)','Preparation of all required forms, petition, counseling with respect to exemptions, attendance at 341 meeting of creditors, and all incidental contacts with creditors (more services outlined in engagement agreement)',1299,'2012-07-30 22:17:54','2012-07-30 22:17:54',853,35),(172,'Review of Self-Prepared Bankruptcy Paperwork','Review of self-prepared bankruptcy paperwork.',250,'2012-07-30 22:19:39','2012-07-30 22:19:39',853,35),(173,'Arizona LLC Formation','Counseling with respect to LLC laws, preparation of all required papers, filing with Arizona Corporation Commission (filing fee charged by ACC is not included in flat fee), publication in local newspaper.',375,'2012-07-30 22:21:55','2012-07-30 22:21:55',853,41),(174,'Arizona DUI','Complete DUI representation in Arizona covers all attorneys fees and costs leading up until trial (trial fee extra). Most cases are resolved by plea bargaining and my flat fee includes the cost of a forensic blood expert review of scientific evidence.',3250,'2012-07-30 22:24:05','2012-07-30 22:24:05',853,116),(175,'Complete Short 