 Corporation or LLC with Tax Planning','Preparation of all documents to form and organize the entity and to make appropriate tax elections.  Delaware, New York, Massachusetts, Maine and other states available.',600,'2012-08-18 10:15:23','2012-08-18 10:15:23',1119,41),(221,'Business formation (Texas) LLC, Series LLC or Inc (S or C)','Draft articles of organization, Texas Secretary of State filing (includes filing fees), draft bylaws/regulations, draft initial organizational meeting, assistance with the application for a tax ID and host the initial organizational meeting (stock issuance)',NULL,'2012-08-24 03:35:17','2012-08-24 03:35:17',1208,41),(222,'Basic Estate Planning Package','Basic Tax Planning, Simple Will, Power of Attorney, Health Care Proxy, and HD Video Recorded Execution Ceremony. ',1250,'2012-08-27 01:39:29','2012-08-27 01:39:29',451,43),(223,'Sophisticated Estate Planning Package','Sophisticated estate plan to ensure your assets are transferred exactly how you desire with minimal income and transfer (estate and gift) tax consequences. This package includes all ancillary products such as health care proxy, power of attorney, etc. Please contact us for more information.',10000,'2012-08-27 01:43:49','2012-08-27 01:43:49',451,43),(224,'most adoption and assisted reproduction services.','Please call for additional information.',NULL,'2012-08-28 20:02:38','2012-08-28 20:02:38',1268,36),(225,'Uncontested Divorce','FIle and prepare documents for an uncontested divorce with children and property. Waiver Divorce with no contested hearings. ',2000,'2012-08-29 19:31:31','2012-08-29 19:31:31',1279,36),(226,'Drafting LLC Agreement (standard)','We will draft a standard LLC agreement for a small business. We will also answer any questions the client may have about how to file appropriately with the State. ',500,'2012-09-10 16:33:36','2012-09-10 16:33:36',1448,41),(227,'Drafting a Simple Will','We will draft a basic, standard will.  This flat fee price does not include wills that incorporate any type of trust, that have more than six beneficiaries or pertain to estates valued at or over $2,000,000.',500,'2012-09-10 16:35:06','2012-09-10 16:35:06',1448,43),(228,'Drafting Simple Reciprocal Wills','We will draft reciprocal basic, standard will.s for spouses  This flat fee price does not include wills that incorporate any type of trust, that have more than six beneficiaries or pertain to estates valued at or over $2,000,000 and always pertains to wills truly reflecting reciprocity and not wills of spouses who seek to implement different estate plans.',750,'2012-09-10 16:36:13','2012-09-10 16:36:13',1448,43),(229,'Drafting a Power of Attorney','Draft and execute a Power of Attorney document',200,'2012-09-10 16:36:45','2012-09-10 16:36:45',1448,43),(230,'Drafting Medical Directive or Living Will','Draft and execute a medical directive, a.k.a living will',200,'2012-09-10 16:37:40','2012-09-10 16:37:40',1448,43),(231,'Mechanics Liens','We will draft, have served, and appropriately file a Mechanics Lien',200,'2012-09-10 16:38:12','2012-09-10 16:38:12',1448,41),(232,'Incorporation and LLC Formation','In connection with corporate formations, I provide and advise on Articles of Incorporation, Bylaws, First Minutes, the capitalization structure of the company and shareholder agreements.  \r\n\r\nFor LLC formations, I provide the Articles of Organization and Operating Agreement along with advise on structuring the capitalization of the company.   ',2300,'2012-09-11 16:28:50','2012-09-11 16:28:50',1462,41),(233,'DUI/DWI','Fees based upon actual case -- depends upon charge, specific events, client\'s circumstances, etc.',2000,'2012-09-12 18:56:51','2012-09-12 18:56:51',1482,116),(235,'Convertible Note or Convertible Note and Warrant Financing for Technology Companies','Prepare Term Sheet, Convertible Note Purchase Agreement, Convertible Promissory Notes, Stock Purchase Warrants (if included) and Board of Directors consent to approve the transacti