 for a job with a company called support.com. Prior to this interview, I had taken a written and verbal test and had apparently passed because I moved on to the next phase in the hiring process. When I spoke to my recruiter I outlined to her my criminal history and asked if it was going to prevent me from working there. Also, I checked the appropriate box on my application indicating that I did in fact have a criminal record. After speaking to the recruiter and telling her everything, she told me that I will be contacted by the HR department the next day to complete the hiring process and to inform them about my background as well.  The following day, I was in fact contacted by HR at support.com by a woman named Michaela. This contact was made via email and contained my job offer letter as well as a few forms to fill out including the background check consent form. I completed everything and informed Michaela about my background as well. In the email, I also informed her that quite a bit of time had gone by since my offenses, I managed to attain a degree, and that I had many professional as well as personal references that could speak on my behalf. She said that she would let me know after the background check came back whether or not I can continue to work there. She acknowledged that I did in fact make them completely aware of my background in writing prior to my employment. (I have all of this correspondence still)  In the meantime, they told me that I was hired and to report to work the following Monday. I did so. Nine Days later, the background check came back. Michaela called me and thanked me for being honest on the application and said that my history matched up with what I had told initially told them. She also told me that I could no longer work there anymore because of my criminal history. They did not allow me an opportunity to speak on my behalf, nor did they make any attempts to speak to my references. They also did not check to see if I had successfully attended any educational institutions or if I had successfully worked for any other employers without incident. They also did not take into consideration that there had not been any new charges or convictions since those for which I was terminated.  It is my understanding that on April 25th 2012 the EEOC updated their policy regarding an employersรขโฌโข use of background checks to screen employees. Support.com did not allow for an individualized determination when making the decision as to whether or not to continue my employment there. Even though this is not required, I think that I may have a wrongful termination case against this company. I am unaware as to whether or not there were other people with similar mitigating factors who were treated differently, but I feel that I was not treated fairly.  Can you please let me know if I should continue to pursue this matter? If so, what should I do? ',NULL,'lawyer','2012-07-19 03:26:55','2012-07-19 03:26:55','Texas','Employment'),(491,'Employment',NULL,'lawyer','2012-07-19 04:22:54','2012-07-19 04:22:54',NULL,NULL),(492,'Employment',690,'lawyer','2012-07-19 04:22:56','2012-07-19 04:23:40',NULL,NULL),(493,'Employment',690,'lawyer','2012-07-19 04:24:56','2012-07-19 04:24:56',NULL,NULL),(494,'custody',NULL,'lawyer','2012-07-19 05:33:40','2012-07-19 05:33:40',NULL,NULL),(495,'Hi, I would like to know if can go to my native country (USA) without any problems, I have a  3 year old kid, right now im living in Mexico but im no longer with the father',NULL,'lawyer','2012-07-19 06:12:24','2012-07-19 06:12:24',NULL,NULL),(496,'Good day,',691,'lawyer','2012-07-19 08:18:32','2012-07-19 08:19:09',NULL,NULL),(497,'Good day,  i\'m married in community of property and i\'m also a 50% shareholder in a company with my husband. I recently found out he\'s been involved in fraudulent activities and now the people he owe money too is threatening claims against the company and my family.',691,'lawyer','2012-07-19 08:20:44','2012-07-19 08