ULL),(709,'My husband was in bad shape, mixing alcohol with his prescriptions and took some things (value under $250, bond was $2,500) out of an unlocked car on June 15, 2012. He was charged with Auto Burglary in the early morning hours of June 16, 2012. He then went to detox and has been attending regular NA/AA meetings and we have been going to church. He has cleaned his life up and is doing so much better.  On July 18, 2012, my husband went to a NA meeting from 7-8pm. I had a rifle in the back of his car and forgot to take it out. We noticed it missing that Friday, the 20th and filed a police report.  On Saturday, July 21, we saw a girl at the grocery store. She told us that one of my husband\'s former \"friends\", her boyfriend, saw our car at the NA meeting on the 18th, was going to leave a note for my husband, saw the gun, and decided to take it instead. We called the local city police, Pascagoula, MS in Jackson County, and told them of our encounter with this girl. The officer was very rude and alluded that my husband traded our gun for drugs. (I know this is not so because I followed him that night and saw him go into the meeting and he got a signed paper from the meeting chairman stating he was there. He was also home by 8:02pm, the meeting ends at 8pm. He was with me every second before and after that meeting up until we reported our gun stolen.) We called and complained about the poor treatment to the Captain after the officer left.  We talked to a detective Monday, July 23rd, the police department had the \"friend\" in custody on other charges with a $26,000.00 bond. They found our gun at a pawn shop and it was returned to us. However, the detective said that the \"friend\" said my husband gave him the gun and he doesn\'t believe our story, \"they just don\'t add up\", and he was only pressing false pretense charges on the guy. Today, Thursday, the officer that we complained about stopped by and said he wanted to talk to my husband again, that he left some things out of his report, and he would come back when my husband got home. This is bordering on harassment, in my opinion, and we are concerned that the police department is trying to pull something. My husband made a mistake, he is 34 and has never been in trouble before this incident. The \"friend\" is a known drug addict, has been in trouble many times, and causes problems wherever he goes. The police are treating us like we are the hard core criminals, and the \"friend\" is the victim. I do not understand why they are treating us so poorly, and I am worried that they are trying to keep my husband down instead of letting him get his life together. I have developed a severe mistrust of the police as of late, and I know it should not be that way. They are supposed to protect and serve.  I know this site doesn\'t have lawyers in MS, and you probably can\'t do much for us here, but we are scared and have no money. My husband is on his way home from looking for work because he is upset and thinks the police department is going to try and say we filed a false report or try to hem him up some other way and from the way they have been treating him, this seems so.  Should we continue to cooperate with the police or not? What should we do? It is 1:30pm CST, and I expect that the officer will stop back by as soon as he sees my husband\'s car. We are contemplating going to the police department and talking with the officer while the Captain on duty is present. We are tired of police cars being at our house as it just looks bad to our neighbors. I honestly am afraid for our rights and we do not know what the police are trying to pull. Please help.',NULL,'lawyer','2012-07-26 18:49:28','2012-07-26 18:49:28','Mississippi','Criminal Defense'),(710,'would i get in trouble if i was with my friend and he stole something but i thought he put it back, and then he walked out of the store when i was looking at the shoes? So i thought he put the key chain back when i went to the shoes section but when i walked out of store to go catch up to him, he said here look what i got for ya and handed it to me. So I had no idea he stole it in the first place.',NULL,'lawyer','2012-07-26 20:08:24','2012-07-26 20:08:24','Wisconsin',NULL),(711,'ok im 15 yrs old and im live with my grandparents and my grandmother can be very mental abusive with out knowing it ive tried counsling everything my mother died last august and my father signed legal guardian ship to them how hard would it be for me to be emancipated or for someone to get custody of me please help me',804,'lawyer','2012-07-26 21:24:50','2012-07-26 21:25:16','Tennessee','Family and Divorce'),(712,'blahhh ',804,'lawyer','2012-07-26 21:53:39','2012-07-26 21:53:51','Tennessee','Civil Disagreements'),(713,'i got married with my spouse in mexico what can i do to bring her with me',805,'lawyer','2012-07-26 22:33:41','2012-07-26 22:34:21','Utah','Immigration'),(714,'\"on item #22 on Dissolution with children is the a easy way\" -- because it falls within my area of expertise. I just need a few more details about your situation and I will get to work!',NULL,'lawyer','2012-07-26 22:36:43','2012-07-26 22:36:43','Minnesota',NULL),(715,'\"on item #22 on Dissolution with children is the a easy way\" -- because it falls within my area of expertise. I just need a few more details about your situation and I will get to work!',806,'lawyer','2012-07-26 22:37:09','2012-07-26 22:37:45','Minnesota',NULL),(716,'',NULL,'lawyer','2012-07-26 23:31:32','2012-07-26 23:31:32','Florida',NULL),(717,'ffdsfsdfsdfdsfdsf',NULL,'lawyer','2012-07-26 23:42:45','2012-07-26 23:42:45','California','Business and Startups'),(718,'',NULL,'lawyer','2012-07-27 00:15:08','2012-07-27 00:15:08','Colorado',NULL),(719,'',808,'lawyer','2012-07-27 00:16:15','2012-07-27 00:17:12','Colorado',NULL),(720,'Can I break the lease if landlord creates unsafe living situation? ',809,'lawyer','2012-07-27 01:24:19','2012-07-27 01:25:03','Michigan','Real Estate'),(7