wing agin he has taken them over 30 miles away. banned them from seeing his family or mine, there is no police records or report that the kids are permenantly in his care or nothing from social services.. is there anything stopping me or family going to the house removing the kids and letting the police and social servies decide where they stay',829,'lawyer','2012-07-28 09:00:39','2012-07-28 09:01:11',NULL,'Civil Disagreements'),(759,'',831,'lawyer','2012-07-28 12:59:03','2012-07-28 13:00:31',NULL,NULL),(760,'I have a friend and she is 15 she has a horrible home life along with her brother and sisters i was just wondering if my mother could file for a temporary custody order even if were not family?? Her step dad forces her to give him foot rubs and if she doesnt she gets grounded, Her and the toddlers which are 3 and 4 get locked in there rooms and they remove the door knobs so they cant get out. Just horrible things the list goes on and on, but i need to know if my mother who is 40 could file for temporary custody of the oldest one who is 15?? ',NULL,'lawyer','2012-07-28 15:02:04','2012-07-28 15:02:04',NULL,NULL),(761,' I used to work at Walmart as a cashier and I was having a lot of financial issues at the time. Obviously that\'s not an excuse for my actions but I ended up taking money from the register to help with my debt. One day I got called down to the office and they asked me if I know why I was down there. After asking me a few questions, I fully admitted to taking the money. They called the police and I ended up getting arrested for a felony theft. They booked me into jail on a Wednesday where I was supposed to wait for my court date which was on a Friday. I ended up getting released on Thursday evening because my court date was cancelled. They never explained the details but they just said that they will contact me if they need me for anything. It has been over a month since that happened, and I just received a letter saying I have court in a few days for it. I\'m really nervous because i have no idea what kind of sentence I can get. My record is clean and I have never been arrested for anything before. I\'m debating on skipping court because I can\'t afford to go to jail right now, but I also know if I do I\'ll have a warrant for my arrest. ',832,'lawyer','2012-07-28 15:03:11','2012-07-28 15:03:33','Minnesota','Employment'),(762,'What kind of sentence would you get for a first time felony? I used to work at Walmart as a cashier and I was having a lot of financial issues at the time. Obviously that\'s not an excuse for my actions but I ended up taking money from the register to help with my debt. One day I got called down to the office and they asked me if I know why I was down there. After asking me a few questions, I fully admitted to taking the money. They called the police and I ended up getting arrested for a felony theft. They booked me into jail on a Wednesday where I was supposed to wait for my court date which was on a Friday. I ended up getting released on Thursday evening because my court date was cancelled. They never explained the details but they just said that they will contact me if they need me for anything. It has been over a month since that happened, and I just received a letter saying I have court in a few days for it. I\'m really nervous because i have no idea what kind of sentence I can get. My record is clean and I have never been arrested for anything before. I\'m debating on skipping court because I can\'t afford to go to jail right now, but I also know if I do I\'ll have a warrant for my arrest. What do you guys think?',832,'lawyer','2012-07-28 15:05:26','2012-07-28 15:05:26','Minnesota','Employment'),(763,'My son was injured by bubbles that kids blow and they went into his eyes swelling them shut and needing immediate medical attention, at hospital they were forced to call poison control because they had no warning label on bottle on what to do if eye contact occurred and his eyes had to