nd asked her when she\'ll be back. There was no talked of how long he would rent the apartment, but that he\'ll take the sublet for the end of June and July. In July, I found out that there has been two shooting in the elevator and asked if she knew about it. Told her that my fiance will not be subleasing in August due to safety concern. A few days later, I got an eviction notice that she didn\'t pay for rent. Emailed her and she said it was an internet error on payment.   Now she wants to take me to court if I do not pay her August\'s rent. Can she and how valid is it if it is really verbal between her and my fiance. Would it matter if her brother testify since he was there to show my fiance the apartment and she only talked to my fiance.',NULL,'lawyer','2012-07-31 21:30:04','2012-07-31 21:30:04','California',NULL),(840,'If I break my engagement, will I have to repay my fiance for expenses he has already paid toward our wedding?',NULL,'lawyer','2012-07-31 22:01:05','2012-07-31 22:01:05','Michigan',NULL),(841,'I\'ve been working as an online secretary for a woman I haven\'t met. She promised me $600 weekly and I\'ve only been paid twice. She owes me $3200 and I want to sue her for fraud and slavery but don\'t know if I should.',877,'lawyer','2012-08-01 00:00:24','2012-08-01 00:01:41','Ohio','Employment'),(842,'i want to give my parents parental rights when i leave to the air force but my sons father name is on the birth certificate but i dont want to give my rights to him. is there anything i can do?',NULL,'lawyer','2012-08-01 00:57:05','2012-08-01 00:57:05','California',NULL),(843,'Hello, I am a personal Trainer (not a group fitness instrucor-which has a different contract) at Goodlife Fitness and I have been teaching (without pay) a Kickboxing Class outside of Goodlife. I am a certified Kickboxing instructor.',NULL,'lawyer','2012-08-01 01:10:55','2012-08-01 01:10:55',NULL,NULL),(844,'Hello, I am a personal Trainer (not a group fitness instrucor-which has a different contract) at Goodlife Fitness and I have been teaching (without pay) a Kickboxing Class outside of Goodlife. I am a certified Kickboxing instructor.',878,'lawyer','2012-08-01 01:10:55','2012-08-01 01:11:23',NULL,NULL),(845,'Why can\'t we file a case against the government? and if we file a case, why does the government always win?',NULL,'lawyer','2012-08-01 01:20:57','2012-08-01 01:20:57',NULL,NULL),(846,'If my class syllabus (contract) states that I need a rating between 5 and 10 in order to pass, then I should pass with a 5 rating correct?',879,'lawyer','2012-08-01 01:57:42','2012-08-01 01:58:00','California',NULL),(847,'If my class syllabus (contract) states that I need a rating between 5 and 10 in order to pass, then I should pass with a 5 rating correct?',879,'lawyer','2012-08-01 01:58:55','2012-08-01 01:58:55','California',NULL),(848,'Custody issues with grandparents',880,'lawyer','2012-08-01 02:16:49','2012-08-01 02:17:12','Georgia','Family and Divorce'),(849,'Well hi ok i recieved SSI for my mental disabilities and, sezuires, they want to take my SSI away. i got an attorney and he did not want to help and i have to go to court in one week and i do not have a attorney. What can i do, Can i appeal or what can i do',881,'lawyer','2012-08-01 02:18:21','2012-08-01 02:19:03','California',NULL),(850,'Statute of Limitations',NULL,'lawyer','2012-08-01 02:24:59','2012-08-01 02:24:59','Nebraska','Bankruptcy'),(851,'I am paying the taxes on a mobile home that I no longer own.  The present owners have failed to register it.  I have contacted the city tax office about this matter several times. Do I still own the mobile since I am paying the taxes? ',NULL,'lawyer','2012-08-01 03:28:49','2012-08-01 03:28:49','Virginia','Tax'),(852,'I am paying the taxes on a mobile home that I no longer own.  The present owners have failed to register it.  I have contacted the city tax office about this matter several times. Do I still own the mobile since I am paying the taxes? ',882,'lawyer','2012-08-01 03:37:04','2012-08-01 03:48:41','Virginia','Tax'),(853,'I am a minor and was parked at a park at 2 in the morning, a cop drove by and asked me to get out of the car and come talk to him. He then asked me if i minded if he searched my car and i said yes i mind. He then proceded to search my car, is this a legal search??? i live in Mansfield, TX',883,'lawyer','2012-08-01 04:32:27','2012-08-01 04:33:03','Texas',NULL),(854,'Hi, I live here in texas and my ex-boss is thinking of taking me to small claims court for property damage. What i did was inscribe words on the front desk at least in two or three different areas of the desk. I also faintly remember doing the same on the back of a phone and some baseboard trim. He might also bring up the fact that i damged some of the carpet. First thing first, the letter inscribing on the desk, phone, and baseboard trim. I am guilty of damging those items. I had a long talk with my boss and we discussed the issue.  Based on what he told me I felt that he was almost approving of those actions, but after that discussion I decided not to do such childish things anymore, in short I completely Stopped carving letters in the wood.  Around the same time my boss allowed me to work on a project in the back room involving solder in which I left a mess on the floor. We also talked about that and came to an agreement that he was ok with it but not to let it happen anymore. After all this we talked and got through these situations in a suitable manner. Then one day a computer was taken from the back room, everything was still okay between us until he spoke to the investagator in which he was told that only someone with a key could have entered the business as there were no signs of a break in. After this the atmosphere within the work enviroment changed dramatically. He kept calm about the theft but kept questioning me and my co-worker if we had taken the computer or if we had any ideas as to rule us out as suspects. Of course we both gave him the same answer \"no\". Eventually it turned into a weekly interrogation of whoo took the laptop suspecting me as well as my family as the ones whoo took the computer. I was ok with him blaming me because I knew my answer would always be no because I know without a doubt i am innocent of that crime. Then during one week he got very upset after he found lettering on the desk that he did not see from before.In short he threw customer property across the room as well as a chair, slammed his head on the wall, and broke the framing of a customers printer. He then got very dipressed and tried to burn down the business(arsen), but i stepped in and took care of the fire he created. After all this unfolded he calmed down and we talked again about the incident, we had yet another very long talk and agreed that we both did very stupid and childish things and decided to put the situation behind us. Again it was to my understanding that even after all that things were good between us. Eventually almost a week or two later he decided to let me go, but before he let me go we made sure that i left in good standing. It was to my understaning that when I left the business everything that happened was in the past and we were ready to move on. Weeks later he decided to call my dad and tell him that he had to let me go not because he could not afford me but he could not afford what i was doing to his business, while also making him aware of the missing computer asking my dad that he sees it that all he wants is for him to return the computer to him. A week or two later he called again letting my dad know that now a laptop was missing from his shop and if he had seen me with a laptop and if he does find his laptop if we could return it to him. Fnally he called again stating that know more stuff is missing and told my parents that he feels kind of mad at the fact that he thinks my parents dont even care and finally decided that he is just going to take me to court for destruction of property. To me i feel as though he is know only taking me to court not because of what i did to his desk, phone , and trim but for his belongings he thinks i stole from him. Can he really sue me for property damage even though we already discussed the property damage and it was to my knowledge that we had already taken care of the problem. Also i always felt that he always suspected me of stealing from him and almost felt harrased by him. He pretty much kept telling that he just wanted his stuff back trying to pressure me into saying that i did steal even though I did not. If i do end up going to court what is my best defense?',NULL,'lawyer','2012-08-01 09:03:56','2012-08-01 09:03:56','Texas','Criminal Defense'),(855,'Hi, I live here in texas and my ex-boss is thinking of taking me to small claims court for property damage. What i did was inscribe words on the front desk at least in two or three different areas of the desk. I also faintly remember doing the same on the back of a phone and some baseboard trim. He might also bring up the fact that i damged some of the carpet. First thing first, the letter inscribing on the desk, phone, and baseboard trim. I am guilty of damging those items. I had a long talk with my boss and we discussed the issue.  Based on what he told me I felt that he was almost approving of those actions, but after that discussion I decided not to do such childish things anymore, in short I completely Stopped carving letters in the wood.  Around the same time my boss allowed me to work on a project in the back room involving solder in which I left a mess on the floor. We also talked about that and came to an agreement that he was ok with it but not to let it happen anymore. After all this we talked and got through these situations in a suitable manner. Then one day a computer was taken from the back room, everything was still okay between us until he spoke to the investagator in which he was told that only someone with a key could