s they would paint all of the soffetts/facia boards, trim, exterior doors and other items. Our only obligation was to allow them to put a sign in our yard and post a bunch of pictures on their website. It seemed legitimate. I did some research on the internet and our only cost would be the IRS when we filed our taxes and submitted a 1099 for the advertisement amount. It would end up costing us in taxes around $500 and it would not cost the insurance company or the mortgage company anything. It would only increase or maintain the value of the property. It seemed like a good reputable deal all the way around. The roof would be replaced in 3-4 days and we could go on with our lives.  So, we signed the contract to replace the roof and we signed the advertising contract which was essentially a credit to do the painting and so forth.   Day 1: Materials didnรขโฌโขt arrive so work did not begin. The painters did start painting. Day 2: Workers showed up when materials did at 1100 and they worked until almost dark. The one thing noted is the Project officer and the foreman where there for less than 1 hour. During the hour that the project officer was there, he stopped the workers from removing the metal valleys. He advised my wife they would just install the new valleys over the old ones hence providing double protection.  A strong selling point was that they would be here for the entire job supervising the project.  Day 3: Workers showed at 0930 and again worked till almost dark. No Project Officer and the foreman was there for about 2 hours. I started to notice mistakes with how they were putting up the drip edge-placing between the shingle and the tar paper after the shingle had been inlaid thereby compromising the integrity of the shingle. I called the project officer and he came out the next day and was upset with the workers for doing it this way and he advised us it would be corrected. Day 4: A window was broken by one of the painters. They agreed to pay for it. We called medina glass and they gave an estimate. The window is still not fixed. The workers worked again till almost dark. Day 5/6: They took the weekend off Day 7: No Foreman and Project Officer wonรขโฌโขt take our calls. Workers are working a snails pace taking almost a 3 hour break..naps on our porch..I could understand this because it was very hot. I finally got in contact with the Project Officer and voiced my concerns with the entire process. He assured me everything was going according to plan and the roof would be done by the end of the week.   Day 8: Project officer and foreman talk to my wife and suggest tile on the balcony versus the mopped composite. They advised the roof structure would hold it since the weight would be about the same as the new mopped flooring. They started the project. First thing I noticed is that they didnรขโฌโขt remove the old composite flooring. I asked the project officer why and he advised it would act as another layer of protection and the additional weight would not be an issue. I then got a call from my wife saying the workers were nailing the 1 รยฝ inch wood screws into the CSB board and then putting tar over the screws. I was livid at this point. I came home from work and asked the foreman if it was true. It was and his justification was that it acted like a shank nail. I called the Project officer and he could not believe they did it this way. He advised they would tear it out and do it right. No roofing was done this day. Day 9: I come home from work and tile is almost all laid. Nothing was done. They simply continued to tile. I tried to call the Project Officer but no answer. Project officer calls later in the day and advises roofers have stopped working since they ran out of shingles. He said we need to call USAA and get approval for 3 more squares. We called USAA and spoke to our adjuster and he advises there was a 20% overage estimated to the job could be done. No roofers  Day 10: Painters showed, no roofers. Much concern at this point so we hire an independent roof inspector to come and  inspect the job. He does and it is not pretty. Many items not done correctly. He advised we get the city involved due to the balcony weight issue and hire an attorney. His professional opinion is respected. I will contact the insurance company and advise. I also e-mailed the Project officer the report so he would know what needs to be corrected. Day 11/12/13: No roofers or painters. I talked to Project Officer and he said no more work until he gets approved from USAA to purchase more shingles and additional labor cost to install. I said you gave your estimate and he advised he was required by USAA to only purchase what their estimated amount of materials was and it was not enough now that the roof was being laid. In the meantime, I have an exposed roof. I call the project officer and advise him of the inspection that was done. He says he is not done with the project yet and the final inspection will show a completed job. I gave him the number to the USAA adjuster and said he can talk to him and explain the need for the additional shingles As of 1020, no roofers/painters. The roof inspector we hired calls me and asks where we stand with the issues he found. I advised I am trying to contact USAA to let them know the details stated above. He also advised me the advertising contract is a common practice in securing projects and sometimes the company sacrifice initial profits to promote future company growth. He said we did nothing wrong as long as we pay the IRS (No problem there!) I left a voicemail for Doug Meyers to contact the Project Officer and myself so we can get this shingle thing straightened out. The project officer calls and says he will be by in 2 hours with materials either way and they will finish the job tomorrow and all errors found by inspector will be corrected.  NOTE: No money has been given to roofer at this point and none of the insurance money will be until the job is done and done right. As the consumer, I want a quality finished product and so does the insurance and mortgage company. I did ask the project officer if they do many advertising agreements and he said all the time. They are the second largest roofing company in Texas and are triple A rated. He advised that he is the one taking the loss here because with or without the advertising agreement, it would have cost him the 28 thousand plus to do the job. The $5500.00 agreement with us is just that a contract between us. It is costing him 28 grand to do the roof and he is paying for the additional items so we will help him advertize his company.  ',976,'lawyer','2012-08-06 18:18:13','2012-08-06 18:19:19','Texas',NULL),(1004,'default on promissary note.  security agreement states in the event of default, may pursue the follwoing remedies withou further notice:  Enter and take possession of the Collateral wherever found immediately after the ten day grace period without notice, how do you do that?',977,'lawyer','2012-08-06 18:59:28','2012-08-06 18:59:48','North Carolina','Business and Startups'),(1005,'this is a test',978,'lawyer','2012-08-06 19:44:21','2012-08-06 19:46:23','California','Business and Startups'),(1006,'I have questions about my boyfriends son\'s mother trying to take a restraning order out against me on his behalf.',981,'lawyer','2012-08-06 19:53:07','2012-08-06 19:53:39','California','Family and Divorce'),(1007,'My boyfriend\'s son\'s mother is trying to take a restraing order out against me for her son. I have questions.',981,'lawyer','2012-08-06 19:54:36','2012-08-06 19:54:36','California','Family and Divorce'),(1008,'if i wrote a written statement at a time when i was very nervous and upset could it be changed',982,'lawyer','2012-08-06 19:55:15','2012-08-06 19:55:41','Florida','Criminal Defense'),(1009,'I sold a World of Warcraft (online game account) the terms of the game states you cannot sell the account. I sold the account to a Canadian company and signed 