e caste to which Shyam belonged.             Both Shyam and Seemsa were disowned by their respective parents. Though they were majors and educated they could not find work. For some they pulled on by selling some belongings of Seema. After six months of their living together, Shyam asked Seema to sell her ornaments including the Mangalsutra (sacred thread/ornaments given by the husband), so that he could go to Dubai in search of a job. At first she was unwilling; however on persuasion she gave in.             Shyam could not find a job in Dubai. He went to Gokul, brother of Seema who was a chief of a company there. He rebuked Shyam and refused to give him a job. Aggrieved by him Shyam stopped sending letters to Seema who was living on the promises in Shyamรขโฌโขs letters. When the flow of letters stopped, she became panicky.             Shyamรขโฌโขs mother on learning the plight of her son in Dubai became angry. Almost daily she started coming to the rented house of Seema and cursing her in front of many. She alleged that seema was responsible for her sonรขโฌโขs sorrows. She said to Seema that she should die so that she may not give birth to her sonรขโฌโขs child.           Next day, Seema was found dead as a result of burns. It appeared that she committed suicide by pouring kerosene all over her body and get fire to her clothes.          Seemaรขโฌโขs parents complained to the police that their daughter was done to death by her mother-in-law. Police started investigation and filed charge sheet against Shyam and his mother under Section 498A and 304B read with Section 34 of Indian Penal Code. Both were found guilty by the trial Court. They appealed to the high court on several grounds including the following grounds:- 1.	That Seema was not Shyamรขโฌโขs legally wedded wife and therefore both Sections 498A and 304B would not be applicable. 2.	That the investigation against Shyam conducted by the police was irregular, improper and illegal as they did not obtain sanction from the Central Government. 3.	That both Sections 498A and 304B need not be charged together as one charge would do. Argue.                  ',1367,'lawyer','2012-09-05 05:38:32','2012-09-05 05:39:25','',''),(1694,'my husband has my kids across the state, and wont bring them back. we do not have court ordered custody, if I want to file for temp custody, do I need to do that where I live, or in the county that he is in and filed the divorce papers in?',1368,'lawyer','2012-09-05 06:10:21','2012-09-05 06:11:09','Florida','Family and Divorce'),(1695,'My key inbetween k and ; doesnt work i apoogize for this. I received a court ordered eviction notice for non payment but i didnt pay because the apartments orders were not competed that was given to them at the summons and compaint court date. They dated that they issued the eviction notice for august 28th but didnt post it on the door unti September 3rd Ieft for work at 230pm and worked from 330 pm unti 1200 am and was notified by the andord that the officers woud be here in the morning to remove my things. Ive had ess than 24 hours notice i dont know what to do?',1369,'lawyer','2012-09-05 06:47:40','2012-09-05 06:48:35','Michigan',''),(1696,'im getting called a peadophile by a 15 year old girl i have proof on my phone via text messages also threating words what can be done',1370,'lawyer','2012-09-05 09:00:01','2012-09-05 09:01:12','England and Wales','Criminal Defense'),(1697,'hello sir/madam?',1371,'lawyer','2012-09-05 10:33:27','2012-09-05 10:34:52','Florida',''),(1698,'hello sir/madam? just wanna ask if I can put up a case between me and my ex friend who did humiliated me in front of many people and shouting a wrong information about me? I was really embarrassed.',1371,'lawyer','2012-09-05 10:37:21','2012-09-05 10:37:21','',''),(1699,'hello sir/madam? just wanna ask if I can put up a case between me and my ex friend who did humiliated me in front of many people and shouting a wrong information about me? I 