, without him being present to sign the papers as well, saying that he would like to be taken off from the lease agreement. When my mother tried reasoning with her and saying she\'d get a notarized letter from her husband saying that he\'d like to be taken off of the lease, she said that he had to come in person which would be impossible. When my mother tried to make a new lease agreement, the manager refused to draw up a new lease. Is what the manager doing unlawful? and can any legal be action be taken if the notarized paper is not accepted? ',1572,'lawyer','2012-09-18 23:05:23','2012-09-18 23:05:50','Florida',''),(2097,'I am dealing with a very frustrating issue. I have a 14 year old out of control teen. I have sent him away to treatment programs, called the local police, I have even contacted Division of Family Services for help. I have not really gotten much help every keeps passing me around call this person or that person will be able to assist and it seems to all end with a dead end. I am still his mother regardless of his behavior and I love him an still try to get inside his heart and help him realize his behavior will get him no where but two places. Even with his bad behavior we had a heart felt conversation where he stressed to me he felt  that he couldn\'t talk to me and basically he wanted a little more credit from me, more trust. The next day we were fine just what our family use to be \"normal\" no wondering where or who he is with. He stayed home to keep an eye on his 11 year old sister and 6 year old brother. Then I got a call about  2hours after me leaving that the police had to kick in my door because someone was calling 911 and hanging up but, when they got inside my 6 year old was alone, the police then got a separate DYFS case going after they had previously left my house maybe two days prior from me reaching out for help for my child. All I tried to do was gain some type of stability in my home and a understanding with my child since I couldn\'t get the help from any where else I was just trying a different avenue hoping to get my child back. At no point in time did I think things would turn out this way, I work in the medical field and I\'m currently seeking a nursing degree. I have worked with the elderly nearly a decade. If I am registered as a negligent parent there goes my career and who will take care of my kids     ',1573,'lawyer','2012-09-19 00:19:08','2012-09-19 00:19:39','New Jersey','Family and Divorce'),(2098,'',NULL,'lawyer','2012-09-19 00:32:17','2012-09-19 00:32:17','',''),(2099,'I moved out of my rental about a month ago when it came time to return our security deposit the landlords are now trying to only give me $50 out of $900 saying they had to have the property sprayed for pest (the pest problem was an issue when i moved in)and because of that they had to replace carpeting in one room i provided them with a letter and receipt rebutiling the charges because during my stay in the home i had pest control out and it is still under warranty til Feb. so if they felt any further attention was needed they could contact that company but unfortunetly they did not have me present for the final walk threw of the home to give them that information i mailed out the letter about a week ago how long do they have to return my request and can they still keep my deposit?',1574,'lawyer','2012-09-19 00:54:45','2012-09-19 00:55:03','Arizona',''),(2100,'',NULL,'lawyer','2012-09-19 01:13:13','2012-09-19 01:13:13','New York',''),(2101,'',NULL,'lawyer','2012-09-19 01:26:19','2012-09-19 01:26:19','',''),(2102,'Dish network allowed someone to open an account with my social without thorough verifying me. What can I do?',1575,'lawyer','2012-09-19 02:25:41','2012-09-19 02:26:17','Florida',''),(2103,'Is there a way to buy back rights to a pornography video from a porn production company?',1576,'lawyer','2012-09-19 02:36:29','2012-09-19 02:36:56','',''),(2104,'',1577,'lawyer','2012-09-19 02:56:08','2012-09-19 02:56