kept the same National Accounts so I was still working around the clock. When I submitted my resignation, I explained my 9-year tenure with the company, my lack of interest in the manipulative sales practice, and the amount of hours I worked off the clock to service my accounts. Their HR department reached out to me and asked me to email her an estimate. Once I did, she responded requiring exact dates. The times and dates are easily pulled from their reports since I had Citrix access, they can easily verify the time and dates I logged in. They also have access to a detailed bill for my work line. I stated a minimum of 9 hours a week for 18 months which I know is lower than what I actually worked. If you have experience in Worker\'s Compensation, that would also be helpful. When I resigned she offered to open a Worker\'s Compensation case for me since she stated I wrote on the email my chronic stress levels were due to their practices. I find this action of theirs odd and would like your opinion on it. Thank you for your time.',NULL,'lawyer','2012-09-20 05:43:02','2012-09-20 05:43:02','California','Employment'),(2149,'',906,'lawyer','2012-09-20 06:41:29','2012-09-20 06:42:27','Texas','Employment'),(2150,'Hi, I have a close friend who has worked for Starbucks for close to two years now. During all of that time, he has a nearly flawless work record. He started working for the company in Dallas and then eventually transferred to a Starbucks location in New York City. Not long ago, he got into a quarrel with his manager over whether or not he (my friend) could record the conversation of his six month employment review. His manager said \"no,\" and my friend noted that it was his understanding that he had the right to record such a conversation. Over time, the working environment became increasingly more tense. At different points, the manager would ask to speak one-on-one with my friend but would only do so if my friend\'s phone was not in the vicinity. Ultimately, it got to the point where the manager asked my friend to remove his phone from the premises. At that point in time, my friend made the impulsive decision to toss his manager\'s phone (which was nearby) into the trash can. The next day, the manger asked my friend to leave early, because he felt that my friend created an uncomfortable work environment. Either the day after or a couple days after, my friend submitted his letter of resignation (which was his two-week notice) that he was quitting. He submitted the letter to the manager. He also informed the manger\'s supervisor of his decision to leave the company. 48 hours later, both the supervisor and manager called my friend into a meeting and fired him from the company. Essentially, they prevented my friend from leaving the company on amicable terms. He is now afraid that future employers will see that he was fired and that that fact will compromise his future career possibilities. All he wants is for Starbucks to change his status to show that he resigned and was not fired. Either way, I want to know if there is a legal case here, and if it would be worth pursuing. I really feel like my friend was messed over by a couple of dolts in a large corporation, and I would like to see things set right. Please email me if you think my friend has a case and if it is worth pursuing. Or general advice would be helpful as well. Thank you, Greg',906,'lawyer','2012-09-20 07:04:36','2012-09-20 07:04:36','New York','Employment'),(2151,'minor possession in school',NULL,'lawyer','2012-09-20 09:36:43','2012-09-20 09:36:43','Texas','Criminal Defense'),(2152,'xishmmbxejohp, &lt;a href=\"http://www.dfzkjoypyw.com\"&gt;xoeqmlbkht&lt;/a&gt; ',NULL,'lawyer','2012-09-20 10:17:28','2012-09-20 10:17:28','Alaska','Bankruptcy'),(2153,'My dad is disabled and I want to know how to go about transfering his house in to my name',NULL,'lawyer','2012-09-20 11:21:10','2012-09-20 11:21:10','Massachusetts',''),(2154,'In the absence of an agreed price, how is t