gration laws and is sensitive to the challenges faced by her clients.\r\nSweta completed her Masters in Law from the University of California, Los Angeles and her JD from the Faculty of Law, India. Across her academic life, Sweta has been recognized at multiple international forums for her sharp analytical and oratory skills. Sweta is also a certified Chartered Accountant from India (equivalent of CPA). This makes her uniquely positioned to understand the immigration needs of her corporate clients in the broader context of their corporate and financial objectives.\r\nSweta is affiliated to several key professional/ community organizations in the Bay Area. She is a member of the American Immigration Lawyers Association and is currently serving as the liaison for the San Jose Customs and Border Protection (CBP) unit of US Department of Homeland Security. Sweta is a regular contributor to several blogs and has frequently addressed several business and professional forums on the latest in corporate and immigration law and its interpretation.\r\n',NULL,0,'40dc1b0d7e19d197969ac04f1e64f2221475002f8298009cc94d0da24cae49e0','Sweta','Khandelwal',NULL,NULL,'4082000972',20,NULL,NULL,NULL,2009,'law-office-of-sweta-khandelwal-santa-clara','Pacific Time (US &amp; Canada)',NULL,NULL,NULL,1,NULL),(167,'taylor.mal.jenkins@gmail.com','4ab3194757f183a3f9d1d40676c19b3dc4c6862e',NULL,NULL,0,1,0,NULL,NULL,'Client',0,'unpaid',NULL,NULL,NULL,NULL,0,NULL,'2012-04-09 15:45:40','2012-07-22 14:13:16',NULL,NULL,NULL,NULL,NULL,NULL,0,'0','Taylor','Jenkins',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Pacific Time (US &amp; Canada)',NULL,NULL,NULL,0,NULL),(168,'xiiiiiiiiii@gmail.com','0399692471a68c613484ad230a189b7e76d791a9',NULL,NULL,0,0,0,'2012-04-09 21:17:05','2012-04-09 21:17:05','Client',0,'unpaid',NULL,NULL,NULL,NULL,0,NULL,'2012-04-09 18:33:11','2012-08-27 14:10:31',NULL,NULL,NULL,NULL,NULL,NULL,0,'4fbb9bf00d1285d8c68aa9c4f1164c8d5103eaa50aa41f0dde5b91cf15c643e8','Alexis','Pribula','cus_H