the filing of criminal charges to trial and sentencing.\r\n \r\nBefore attending law school, I worked for over three years as a reserve Deputy Sheriff with the Los Angeles County Sheriffรขโฌโขs Department.  During that time, I worked uniformed patrol and was involved in all aspects of criminal investigation, from traffic stops to bank robberies and homicide cases. During my time in the academy, I received honors as the top cadet in academics and firearms.  I was also given the highest award and named Honor Cadet by the Sheriffรขโฌโขs Department.\r\n \r\nIn addition to being a trial lawyer, I have taught extensively on many aspects of the law.  I currently teach all areas of criminal law at a state-approved police academy, including courses on search and seizure law, criminal interrogation and the laws of arrest.  I also teach a course on homicide investigation at a local community college.  I have trained other prosecutors during seminars for the California District Attorneyรขโฌโขs Association (CDAA) in the areas of trial tactics and crimes against children.\r\n \r\nAfter leaving the DAรขโฌโขs office, I opened my own practice, focused exclusively on criminal defense.  As a solo practitioner, every client gets my personal representation.',NULL,0,'0','Joe','Dane',NULL,NULL,'714.532.3600',15,NULL,NULL,188,1996,'law-office-of-joe-dane-orange','Pacific Time (US &amp; Canada)','2_MX4xNjczNDM3MX5-VGh1IEF1ZyAxNiAxNToxNjo0OSBQRFQgMjAxMn4wLjMzNjg4MDYyfg','','',1,NULL),(473,'alfredo.figueroa93@gmail,com','c59ac3cedc9aefbaf5027bcf20b8d3c67b0bc515',NULL,NULL,0,0,0,NULL,'2012-06-25 23:51:47','Client',0,'unpaid',NULL,NULL,NULL,NULL,0,NULL,'2012-06-25 23:34:09','2012-07-22 14:13:17',NULL,NULL,NULL,NULL,NULL,NULL,0,'0','Alfredo','Figueroa',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Pacific Time (US &amp; Canada)',NULL,NULL,NULL,0,NULL),(474,'msafiri.vincent72@hotmail.com','6e2b35efda13559b386f0afe3a608e22f3ef3a22',NULL,NULL,0,1,0,NULL,NULL,'Client',0,'unpaid',NULL,NULL,NU