ies to mid-sized and small companies, as well as individuals undergoing the U.S. immigration process.\r\n\r\nMr. Sapochnick has been quoted by numerous newspapers and radio shows worldwide. He has written articles for various publications in North America. He also published an e-book on TN NAFTA visas available online at www.tnvisaexpert.com. Mr. Sapochnick also presides over e-inquires from visitors to many online communities seeking information about US Immigration. Mr. Sapochnick is an avid speaker and has recently been featured in a workshop about US Visas at the San Diego Career Expo, the largest job fair in Southern California. He actively attends immigration seminars and conferences throughout North America.\r\n\r\nMr. Sapochnick is an Immigration attorney with offices in San Diego - California and Tijuana - Mexico. He is fluent in Russian and Hebrew and conversant in French.',NULL,0,'0','Jacob','Sapochnick',NULL,NULL,'6192039944',20,NULL,NULL,NULL,NULL,NULL,'Pacific Time (US &amp; Canada)',NULL,NULL,NULL,1,NULL),(1130,'bewitched5078893@aol.com','4bc599e6feeb66af1f8e46dd3aea16319d59af31',NULL,NULL,0,0,0,NULL,NULL,'Client',0,'unpaid',NULL,NULL,NULL,NULL,0,NULL,'2012-08-17 23:12:41','2012-08-17 23:12:41',NULL,NULL,NULL,NULL,NULL,NULL,0,'0','Ashley','Tucker',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Pacific Time (US &amp; Canada)',NULL,NULL,NULL,0,NULL),(1131,'ht_man1@yahoo.com','5f50a84c1fa3bcff146405017f36aec1a10a9e38',NULL,NULL,0,0,0,'2012-08-18 14:22:01','2012-08-18 14:22:01','Client',0,'unpaid',NULL,NULL,NULL,NULL,0,NULL,'2012-08-17 23:34:38','2012-08-27 14:10:33',NULL,NULL,NULL,NULL,NULL,NULL,0,'0','jeff','r',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Pacific Time (US &amp; Canada)',NULL,NULL,NULL,0,NULL),(1132,'hbugg@tampabay.rr.com','de9c5b6181ee6ed310d2aad799ede45b782e1677',NULL,NULL,0,0,0,'2012-08-26 10:55:19','2012-08-26 10:58:25','Lawyer',1,'free',NULL,NULL,NULL,NULL,4.17,NULL,'2012-08-18 00:30:28','2012-09-23 21:30:38','headshot.JPG','image/j